import React from "react";
import notes from "../notes.js";

function createCard(notes){
    return(
        <div className = "note">
            <Card 
                key = {notes.key}
                title = {notes.title}
                content = {notes.content}
            />
        </div>
    );
}

function Note(){
    return (
        <div className = "note">
            <h1>Enter Title Here</h1>
            <p></p>
        </div>
    );
}

export default Note;
